def solve(n):
    # calculate sum of the first n odd numbers to the power of 7
    sum_n = (n * (2*n - 1) * (2*(n*n) - 3*n + 3) ** 2) // 3

    # multiply all odd digits of the resulting sum
    product = 1
    for digit in str(sum_n):
        if int(digit) % 2 == 1:
            product *= int(digit)

    return product
